import React from 'react';
import './App.css';

//-------------------------------------------------
//Components import
import Positions from './Components/positions.jsx';


//-------------------------------------------------
//Data Source
// import obj from './Data/data.js';
let obj = 
[{"Datum":"18.5.2020, 09:09:31","TradeCollateral":"8","AccountBallance":"8","Faktor":"8","Einstiegspreis":"888","StatusAktiv":false,"_id":"AsXnPh9oxxzRiJ13"},
{"Datum":"18.5.2020, 09:23:41","TradeCollateral":"300","AccountBallance":"500","Faktor":"2","Einstiegspreis":"8800","StatusAktiv":true,"_id":"GpAVUsg3JDrHeki0"}];


//-------------------------------------------------

function App() {
  const Positionz = obj.map(details => 
    {return (<Positions 
      Datum={details.Datum}
      TradeCollateral={details.TradeCollateral}
      AccountBallance={details.AccountBallance}
      Faktor={details.Faktor}
      Einstiegspreis={details.Einstiegspreis}
      StatusAktiv={details.StatusAktiv}
    />)}
    )
    return (
      <div>
        {Positionz}
      </div>
    );
}



//-------------------------------------------------
//Export
export default App;
